/**
 * Maps site contact details from the mx api to a site contact details object for widgets to use.
 * @hidden
 */
export function mapMxSiteContactDetailsToWidgetSiteContactDetails(contactDetails) {
    return {
        phoneNumber1: contactDetails.phoneNumber1,
        phoneNumber2: contactDetails.phoneNumber2,
        faxNumber: contactDetails.faxNumber,
        emailAddress: contactDetails.emailAddress
    };
}
